号码组成。','先从万位、千位、百位、十位、个位中选定三个位置，再从0-9中选择1个号码，每注由1个号码组成，只要开奖号码上你所选取的三个位置包含有所选号码，即为中奖。','如：选千位、十位、个位三个位置，选择一码不定位4，开出*4***、***4*、****4即为中奖。','bddR3','dwd','bdd','ssc_5x_r3','1','0','1000'),('220','前二大小单双','1','5','7.76','6.80','0','65','对万位和千位的“大小单双”形态进行购买。','对万位和千位的“大（56789）小（01234）、单（13579）双（02468）”形态进行购买，所选号码的位置、形态与开奖号码的位置、形态相同，即为中奖。','如：万位选择大，千位选择单，开出63***即为中奖。','dsQ2','dxds','dxds','ssc_dxds_q2','1','0','16');/* MySQLReback Separation */
